object DataDummy {
    fun getBorrowedBooks(): LiveData<List<BorrowedBook>> {
        val liveData = MutableLiveData<List<BorrowedBook>>()

        val listOfBook = ArrayList<BorrowedBook>()
        repeat(10) {
            val borrowedBook = BorrowedBook(
                id = 31,
                bookData = Book(
                    idBook = 271837,
                    title = "Si Putih",
                    isbn = "9786020652252",
                    description = """Bagaimana jika hewan kesayangan kalian ternyata hewan dengan kekuatan terbesar di dunia pararel? Bagaimana jika hewan yang terlihat imut, menggemaskan, ternyata bisa menjadi salah satu petarung paling hebat?

Kali ini kita akan bertualang di klan baru, dengan tokoh-tokoh baru. Termasuk mengetahui bahwa pandemi yang menyusahkan penduduk juga terjadi di klan-klan jauh. Tapi ingatlah selalu, setiap ada kesusahan, selalu muncul hal-hal menarik yang positif.

Kisah ini tentang si Putih, kucing kesayangan Raib. Masa lalu si Putih tidak kalah menarik, sebelum akhirnya kucing itu diletakkan di depan pintu rumah sebagai hadiah ulang tahun Raib.""".trimIndent(),
                    author = "Tere Liye",
                    cover = "",
                    publisher = "PT Gramedia Pustaka Utama",
                    releaseYear = "2021",
                    stock = 5,
                    category = "Novel Fiksi",
                ),
                borrowDate = "2/12/2021",
                returnDate = if (it < 2) "16/12/2021" else "01/12/2021",
                borrowStatus = if (it < 2) 1 else 2,
            )
            listOfBook.add(borrowedBook)
            liveData.value = listOfBook
        }
        return liveData
    }

